.com\nspring.mail.port=25\nspring.mail.username=xxx@qq.com\nspring.mail.from=xxx@qq.com\nspring.mail.password=xxx\nspring.mail.properties.mail.smtp.auth=true\nspring.mail.properties.mail.smtp.starttls.enable=true\nspring.mail.properties.mail.smtp.starttls.required=true\nspring.mail.properties.mail.smtp.socketFactory.class=javax.net.ssl.SSLSocketFactory\n\n### xxl-job, access token\nxxl.job.accessToken=jrmall2013\n\n### xxl-job, i18n (default is zh_CN, and you can choose \"zh_CN\", \"zh_TC\" and \"en\")\nxxl.job.i18n=zh_CN\n\n## xxl-job, triggerpool max size\nxxl.job.triggerpool.fast.max=200\nxxl.job.triggerpool.slow.max=100\n\n### xxl-job, log retention days\nxxl.job.logretentiondays=30\n\n## 执行器 ID map\nxxl.job.job-goup-map.material=3\nxxl.job.job-goup-map.order=5\n','744f76ed72b79f35d4a0120db82fc906','2023-07-27 11:10:34','2023-07-27 12:27:09','nacos','172.16.85.68','','dev','','','','properties','',''),(2404,'xxl-job-admin-config.yml','DEFAULT_GROUP','management:\n  health:\n    mail:\n      enabled: false\n  server:\n    servlet:\n      context-path: /actuator\nmybatis:\n  mapper-locations: classpath:/mybatis-mapper/*Mapper.xml\nserver:\n  servlet:\n    context-path: /xxl-job-admin\nspring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    hikari:\n      auto-commit: true\n      connection-test-query: SELECT 1\n      connection-timeout: 10000\n      idle-timeout: 30000\n      max-lifetime: 900000\n      maximum-pool-size: 30\n      minimum-idle: 10\n      pool-name: HikariCP\n      validation-timeout: 1000\n    password: xxl-job-dev\n    type: com.zaxxer.hikari.HikariDataSource\n    url: jdbc:mysql://172.16.85.105:3306/xxl-job-dev?useUnicode=true&characterEncoding=UTF-8&autoReconnect=true&serverTimezone=Asia/Shanghai\n    username: xxl-job-dev\n  freemarker:\n    charset: UTF-8\n    request-context-attribute: request\n    settings:\n      number_format: \'0.##########\'\n    suffix: .ftl\n    templateLoaderPath: classpath:/templates/\n  mail:\