:06:36','2023-09-25 03:07:35','nacos','172.16.85.166','','dev','','','','yaml','',''),(5332,'oauth2-front-whitelist.yml','DEFAULT_GROUP','oauth2:\n  whitelist:\n    urls:\n      - \"/v3/api-docs\"\n      - \"/swagger-resources\"\n      - \"/swagger-resources/**\"\n      - \"/login\"\n      - \"/logout\"\n      - \"/oauth2-front/**\"\n      - \"/api/front/user/auth/login\"\n      - \"/api/front/user/auth/refreshToken\"\n      - \"/api/front/user/auth/logout\"\n      - \"/api/front/sms/sendCode\"\n      - \"/api/front/user/auth/wxmini/login\"\n      - \"/api/front/user/auth/wxmini/bind\"\n      - \"/api/front/user/findPwd\"','ffb261a10497956708804a1237b77bb2','2023-08-28 08:43:11','2023-09-18 06:51:04','nacos','172.16.85.134','','prod','','','','yaml','',''),(5610,'wx-third-config.yml','DEFAULT_GROUP','weixin:\n  third: #第三方平台参数\n    # 第三方平台APPID\n    app-id: wx5560a818a557c6ba\n    # 第三方平台AppSecret\n    app-secret: 446cf3d23493655cb77eb4c771a2a5f8\n    # 第三方平台消息校验Token\n    msg-token: 446cf3d23493655cb77eb4c7\n    # 第三方平台消息加解密Key\n    encoding-aes-key: 446cf3d23493655cb77eb4c771a2a5f8wx5560a818a\n    # 第三方平台域名\n    domain: api.weixin.qq.com\n    # 协议(默认使用HTTPS)\n    protocol: https\n    #  授权回调 URI(填写格式为https://xxx)。管理员授权确认之后会自动跳转进入回调 URI，并在 URL 参数中返回授权码和过期时间(redirect_url?auth_code=xxx&expires_in=600)\n    auth-redirect-uri: https://juru.new.jrmall.cn/api/admin/wx/third/auth/redirect/{enterpriseId}\n    # 授权回调数据保存后转发到redirect-url 页面\n    auth-success-redirect-url: https://juru.dev.jrmall.cn/wx/third/auth_success.html\n    auth-failed-redirect-url: https://juru.dev.jrmall.cn/wx/third/auth_failed.html\n    #要授权的帐号类型，即商家点击授权链接或者扫了授权码之后，展示在用户手机端的授权帐号类型。1 表示手机端仅展示公众号；2 表示仅展示小程序，3 表示公众号和小程序都展示。如果为未指定，则默认小程序和公众号都展示。\n    auth-type: 2\n    component-phone: \'0571-89973966\'\n    api:\n      # 令牌（component_access_token）是第三方平台接口的调用凭据 每个令牌的有效期为 2 小时\n      component-token: /cgi-bin/component/api_component_token\n      # 获取预授权码 该接口用于获取预授权码（pre_auth_code）是第三方平台方实现授权托管的必备信息，每个预授权码有效期为 1800秒\n      create-preauthcode: /cgi-bin/component/api_create_preauthcode?access_token={ACCESS_TOKEN}\n      # PC版授权链接\n      pc-auth-url: https://mp.weixin.qq.com/cgi-bin/componentloginpage?component_appid={component_appid}&pre_auth_code={pre_auth_code}&redirect_uri=${pay.wxpay.third.auth-redirect-uri}&auth_type=${pay.wxpay.third.auth-type}\n      # 5版授权链接\n      h5-auth-url: https://open.weixin.qq.com/wxaopen/safe/bindcomponent?action=bindcomponent&no_scan=1&component_appid={component_appid}&pre_auth_code={pre_auth_code}&redirect_uri=${pay.wxpay.third.api.auth-redirect-uri}&auth_type=${pay.wxpay.third.auth-type}#wechat_redirect\n      # 获取刷新令牌 当用户在第三方平台授权页中完成授权流程后，第三方平台开发者可以在回调 URI 中通过 URL 参数获取授权码(authorization_code)。然后使用该接口可以换取公众号/小程序的刷新令牌（authorizer_refresh_token）\n      query-auth: /cgi-bin/component/api_query_auth?access_token={ACCESS_TOKEN}\n      # 获取授权帐号调用令牌 该接口用于获取授权帐号的authorizer_access_token。authorizer_access_token 有效期为 2 小时，authorizer_access_token 失效时，可以使用 authorizer_refresh_token 获取新的 authorizer_access_token\n      authorizer-token: /cgi-bin/component/api_authorizer_token?component_access_token={ACCESS_TOKEN}\n      # 获取授权帐号详情 该 API 用于获取授权方的基本信息，包括头像、昵称、帐号类型、认证类型、原始ID等信息。\n      authorizer-info: /cgi-bin/component/api_get_authorizer_info?access_token={ACCESS_TOKEN}\n      # 新增临时素材 众号经常有需要用到一些临时性的多媒体素材的场景， 例如在使用接口特别是发送消息时，对多媒体文件、多媒体消息的获取和调用等操作，是通过media_id来进行的。\n      media-upload: /cgi-bin/media/upload?access_token={ACCESS_TOKEN}&type={TYPE}\n      # 获取临时素材 公众号可以使用本接口获取临时素材（即下载临时的多媒体文件）。\n      media-get: /cgi-bin/media/get?access_token={ACCESS_TOKEN}&media_id={MEDIA_ID}\n      # 获取永久素材 在新增了永久素材后，开发者可以根据media_id通过本接口下载永久素材。公众号在公众平台官网素材管理模块中新建的永久素材，可通过\"获取素材列表\"获知素材的media_id\n      material-get: /cgi-bin/material/get_material?access_token={ACCESS_TOKEN}\n      # 拉取已授权的帐号信息 使用本 API 拉取当前所有已授权的帐号基本信息。\n      authorizer-list: /cgi-bin/component/api_get_authorizer_list?access_token={ACCESS_TOKEN}\n      # 快速注册企业小程序 创建任务逻辑串行，单次任务结束后才可以使用相同信息下发第二次任务，请注意规避任务阻塞\n      fastregisterweapp-create: /cgi-bin/component/fastregisterweapp?action=create&component_access_token={ACCESS_TOKEN}\n      # 查询创建任务状态 该接口只提供当下任务结果查询，不建议过分依赖该接口查询所创建小程序\n      fastregisterweapp-search: /cgi-bin/component/fastregisterweapp?action=search&component_access_token={ACCESS_TOKEN}\n      # 小程序名称检测 调用本 API 可以检测微信认证的名称是否符合规则\n      check-nickname: /cgi-bin/wxverify/checkwxverifynickname?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置小程序名称 调用本接口可以设置小程序名称，当名称没有命中关键词，则直接设置成功；当名称命中关键词，需提交证明材料，并需要审核。审核结果会向消息与事件接收 URL 进行事件推送\n      set-nickname: /wxa/setnickname?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询小程序名称审核状态 调用设置名称接口，如果需要审核，会返回审核单 id（audit_id）,使用本接口可以查询改名审核状态\n      query-nickname-status: /wxa/api_wxa_querynickname?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置小程序介绍 调用本接口可以修改功能介绍。报错53204请注意： 1、signature长度4~120。 2、signature至少4个字的中文描述。\n      modify-signature: /cgi-bin/account/modifysignature?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 修改头像 调用本接口可以修改小程序的头像\n      modify-head-image: /cgi-bin/account/modifyheadimage?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 配置小程序服务器域名 授权给第三方的小程序，其服务器域名只可以为在第三方平台账号中配置的小程序服务器域名，当小程序通过第三方平台发布代码上线后，小程序原先自己配置的服务器域名将被删除，只保留第三方平台的域名，所以第三方平台在代替小程序发布代码之前，需要调用接口为小程序添加第三方平台自身的域名\n      modify-server-domain: /wxa/modify_domain?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置第三方平台服务器域名 授权给第三方代开发的小程序，其服务器域名只可以为在第三方平台账号中配置的小程序服务器域名。即调用接口设置小程序服务器域名之前可以调本接口先进行第三方平台小程序服务器域名配置\n      modify-thirdparty-server-domain: /cgi-bin/component/modify_wxa_server_domain?access_token={ACCESS_TOKEN}\n      # 获取草稿箱列表 通过本接口，可以获取第三方平台草稿箱中所有的草稿\n      templated-raft-list: /wxa/gettemplatedraftlist?access_token={ACCESS_TOKEN}\n      # 将草稿添加到模板库 接口用于将草稿添加到模板库设置为持久的代码模板\n      add-to-template: /wxa/addtotemplate?access_token={ACCESS_TOKEN}\n      # 获取模板列表 通过该接口可以获取模板库里的模板列表信息\n      template-list: /wxa/gettemplatelist?access_token={ACCESS_TOKEN}\n      # 删除代码模板 通过该接口可以删除指定的模板。因为代码模板库的模板数量是有上限的，当达到上限或者有某个模板不再需要时，建议调用本接口删除指定的代码模板\n      delete-template: /wxa/deletetemplate?access_token={ACCESS_TOKEN}\n      # 小程序登录 第三方平台开发者的服务器使用登录凭证code以及第三方平台的 component_access_token 可以代替小程序实现登录功能 获取 session_key 和 openid。\n      thirdparty-code-2-session: /sns/component/jscode2session?grant_type=authorization_code&component_appid={COMPONENT_APPID}&appid={APPID}&js_code={JSCODE}&component_access_token={ACCESS_TOKEN}\n      # 绑定体验者 第三方平台在帮助旗下授权的小程序提交代码审核之前，可先让小程序运营者体验，体验之前需要将运营者的个人微信号添加到该小程序的体验者名单中\n      bind-tester: /wxa/bind_tester?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 解除绑定体验者 调用本接口可以将特定微信用户从小程序的体验者列表中解绑\n      unbind-tester: /wxa/unbind_tester?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取体验者列表 通过本接口可以获取小程序所有已绑定的体验者列表\n      tester: /wxa/memberauth?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传代码并生成体验版 第三方平台需要先通过addToTemplate接口将草稿添加到代码模板库，然后从代码模板库中通过getTemplateList接口获取对应的模板 id（template_id），然后调用本接口可以为已授权的小程序上传代码并生成体验版\n      code-commit: /wxa/commit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取已上传的代码页面列表 通过本接口可以获取由commit接口上传代码的页面列表\n      code-page: /wxa/get_page?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取体验版二维码 调用本接口可以获取小程序的体验版二维码\n      trial-qr-code: /wxa/get_qrcode?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 提交代码审核 在调用commit为小程序上传代码后，可以调用本接口，将上传的代码提交审核\n      code-submit-audit: /wxa/submit_audit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 加急代码审核 有加急次数的第三方可以通过该接口，对已经提审的小程序进行加急操作，加急后的小程序预计2-12小时内审完。但是若代码中包含较复杂逻辑或其他特殊情况，可能会导致审核时间延长\n      speedup-code-audit: /wxa/speedupaudit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询审核单状态 通过接口提交审核后，调用本接口可以查询指定发布审核单的审核状态\n      code-audit-status: /wxa/get_auditstatus?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询最新一次审核单状态 调用本接口可以查询最新一次提审单的审核状态\n      code-latest-audit-status: /wxa/get_latest_auditstatus?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 撤回代码审核 调用本接口可以撤回当前的代码审核单\n      code-undo-audit: /wxa/undocodeaudit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 发布已通过审核的小程序\n      code-release: /wxa/release?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 小程序版本回退 调用本接口可以将小程序的线上版本进行回退\n      revert-code-release: /wxa/revertcoderelease?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取可回退的小程序版本\n      code-release-history: /wxa/revertcoderelease?action=get_history_version&access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传提审素材 调用本接口可将小程序页面截图和操作录屏上传，提审时带上相关参数，可以帮助审核人员判断\n      upload-media-to-code-audit: /wxa/uploadmedia?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询小程序版本信息 调用本接口可以查询小程序的体验版和线上版本信息,如果需要查询审核中版本信息可通过getLatestAuditStatus接口获取.\n      version-info: /wxa/getversioninfo?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询最新一次审核单状态 调用本接口可以查询最新一次提审单的审核状态\n      latest-audit-status: /wxa/get_latest_auditstatus?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取可设置的所有类目 本接口可以获取该小程序允许设置的所有类目且仅支持获取一级类目和二级类目，注意不同主体所允许设置的类目不同\n      all-categories: /cgi-bin/wxopen/getallcategories?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取已设置的所有类目 使用本接口获取小程序已设置的所有类目\n      setting-categories: /cgi-bin/wxopen/getcategory?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 添加类目 调用本接口可以给小程序添加类目，添加的类目需要在所有可设置的类目列表中\n      add_category: /cgi-bin/wxopen/addcategory?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 删除类目 调用本接口可以删除小程序的指定类目\n      delete-category: /cgi-bin/wxopen/deletecategory?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取类目名称信息 接口可获取已设置的二级类目及用于代码审核的可选三级类目\n      all-category-name: /wxa/get_category?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置小程序用户隐私保护指引 本接口用于配置第三方代开发小程序的用户隐私保护指引。可根据小程序实际情况进行完善。小程序发布后即向c端用户展示。\n      privacy-setting-set: /cgi-bin/component/setprivacysetting?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序用户隐私保护指引 本接口用于查询第三方代开发小程序的用户隐私保护指引，也可以用来查询有哪些privacy_key可以进行配置。\n      privacy-setting-get: /cgi-bin/component/getprivacysetting?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传小程序用户隐私保护指引 本接口用于上传自定义的小程序的用户隐私保护指引。\n      upload-privacy-setting: /cgi-bin/component/uploadprivacyextfile?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 发起小程序管理员人脸核身,调用该接口时会向 access_token 所指定的小程序的管理员发送一条备案人脸核身通知，管理员点击该通知即可进行人脸核身。待管理员完成核身之后，平台会推送人脸核身完成事件到服务商服务器，服务商也可以使用查询人脸核身任务状态接口来轮询任务状态和结果。\n      create-icp-verify-task: /wxa/icp/create_icp_verifytask?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询人脸核身任务状态 该接口用于查询人脸核身任务的状态和结果\n      query-icp-verify-task: /wxa/icp/query_icp_verifytask?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传小程序备案媒体材料 备案小程序需要提交图片或视频媒体材料，使用该接口完成媒体材料上传\n      upload-icp-media: /wxa/icp/upload_icp_media?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 申请小程序备案 该接口使用的媒体材料都是通过\"上传小程序备案媒体材料\"接口返回的media_id\n      apply-icp-filing: /wxa/icp/apply_icp_filing?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 撤回小程序备案申请 使用该接口撤回正在流程中的备案申请。\n      cancel-apply-icp-filing: /wxa/icp/cancel_apply_icp_filing?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序备案状态及驳回原因 使用该接口获取小程序备案状态，如果小程序未备案通过，则返回其驳回原因。\n      get-icp-entrance-info: /wxa/icp/get_icp_entrance_info?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序已备案详情\n      get-online-icp-order: /wxa/icp/get_online_icp_order?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序服务内容类型\n      query-icp-service-content-types: /wxa/icp/query_icp_service_content_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取证件类型\n      query-icp-certificate-types: /wxa/icp/query_icp_certificate_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取区域信息 使用该接口查询省市区的区域信息。\n      query-icp-district-code: /wxa/icp/query_icp_district_code?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取前置审批项类型 使用该接口获取小程序备案前置审批项类型定义。\n      query-icp-nrlx-types: /wxa/icp/query_icp_nrlx_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取单位性质\n      query-icp-subject-types: /wxa/icp/query_icp_subject_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 注销小程序备案 1.注销备案不能被撤回。2.注销备案时工信部会给主体负责人或小程序负责人（取决于注销类型）下发一条验证短信，如果想终止注销流程，忽略该条短信即可。\n      cancel-icpfiling: /wxa/icp/cancel_icp_filing?access_token={AUTHORIZER_ACCESS_TOKEN}','021ea138e48bc97ad79fefba46444b33','2023-08-29 07:32:24','2023-11-27 03:19:29','nacos','172.16.85.134','','dev','','','','yaml','',''),(5611,'wx-third-config.yml','DEFAULT_GROUP','weixin:\n  third: #第三方平台参数\n    # 第三方平台APPID\n    app-id: wx5560a818a557c6ba\n    # 第三方平台AppSecret\n    app-secret: 446cf3d23493655cb77eb4c771a2a5f8\n    # 第三方平台消息校验Token\n    msg-token: 446cf3d23493655cb77eb4c7\n    # 第三方平台消息加解密Key\n    encoding-aes-key: 446cf3d23493655cb77eb4c771a2a5f8wx5560a818a\n    # 第三方平台域名\n    domain: api.weixin.qq.com\n    # 协议(默认使用HTTPS)\n    protocol: https\n    #  授权回调 URI(填写格式为https://xxx)。管理员授权确认之后会自动跳转进入回调 URI，并在 URL 参数中返回授权码和过期时间(redirect_url?auth_code=xxx&expires_in=600)\n    auth-redirect-uri: https://juru.prod.jrmall.cn/api/admin/wx/third/auth/redirect/{enterpriseId}\n    # 授权回调数据保存后转发到redirect-url 页面\n    auth-success-redirect-url: https://juru.prod.jrmall.cn/wx/third/auth_success.html\n    auth-failed-redirect-url: https://juru.prod.jrmall.cn/wx/third/auth_failed.html\n    #要授权的帐号类型，即商家点击授权链接或者扫了授权码之后，展示在用户手机端的授权帐号类型。1 表示手机端仅展示公众号；2 表示仅展示小程序，3 表示公众号和小程序都展示。如果为未指定，则默认小程序和公众号都展示。\n    auth-type: 2\n    component-phone: \'0571-89973966\'\n    api:\n      # 令牌（component_access_token）是第三方平台接口的调用凭据 每个令牌的有效期为 2 小时\n      component-token: /cgi-bin/component/api_component_token\n      # 获取预授权码 该接口用于获取预授权码（pre_auth_code）是第三方平台方实现授权托管的必备信息，每个预授权码有效期为 1800秒\n      create-preauthcode: /cgi-bin/component/api_create_preauthcode?access_token={ACCESS_TOKEN}\n      # PC版授权链接\n      pc-auth-url: https://mp.weixin.qq.com/cgi-bin/componentloginpage?component_appid={component_appid}&pre_auth_code={pre_auth_code}&redirect_uri=${pay.wxpay.third.auth-redirect-uri}&auth_type=${pay.wxpay.third.auth-type}\n      # 5版授权链接\n      h5-auth-url: https://open.weixin.qq.com/wxaopen/safe/bindcomponent?action=bindcomponent&no_scan=1&component_appid={component_appid}&pre_auth_code={pre_auth_code}&redirect_uri=${pay.wxpay.third.api.auth-redirect-uri}&auth_type=${pay.wxpay.third.auth-type}#wechat_redirect\n      # 获取刷新令牌 当用户在第三方平台授权页中完成授权流程后，第三方平台开发者可以在回调 URI 中通过 URL 参数获取授权码(authorization_code)。然后使用该接口可以换取公众号/小程序的刷新令牌（authorizer_refresh_token）\n      query-auth: /cgi-bin/component/api_query_auth?access_token={ACCESS_TOKEN}\n      # 获取授权帐号调用令牌 该接口用于获取授权帐号的authorizer_access_token。authorizer_access_token 有效期为 2 小时，authorizer_access_token 失效时，可以使用 authorizer_refresh_token 获取新的 authorizer_access_token\n      authorizer-token: /cgi-bin/component/api_authorizer_token?component_access_token={ACCESS_TOKEN}\n      # 获取授权帐号详情 该 API 用于获取授权方的基本信息，包括头像、昵称、帐号类型、认证类型、原始ID等信息。\n      authorizer-info: /cgi-bin/component/api_get_authorizer_info?access_token={ACCESS_TOKEN}\n      # 新增临时素材 众号经常有需要用到一些临时性的多媒体素材的场景， 例如在使用接口特别是发送消息时，对多媒体文件、多媒体消息的获取和调用等操作，是通过media_id来进行的。\n      media-upload: /cgi-bin/media/upload?access_token={ACCESS_TOKEN}&type={TYPE}\n      # 获取临时素材 公众号可以使用本接口获取临时素材（即下载临时的多媒体文件）。\n      media-get: /cgi-bin/media/get?access_token={ACCESS_TOKEN}&media_id={MEDIA_ID}\n      # 获取永久素材 在新增了永久素材后，开发者可以根据media_id通过本接口下载永久素材。公众号在公众平台官网素材管理模块中新建的永久素材，可通过\"获取素材列表\"获知素材的media_id\n      material-get: /cgi-bin/material/get_material?access_token={ACCESS_TOKEN}\n      # 拉取已授权的帐号信息 使用本 API 拉取当前所有已授权的帐号基本信息。\n      authorizer-list: /cgi-bin/component/api_get_authorizer_list?access_token={ACCESS_TOKEN}\n      # 快速注册企业小程序 创建任务逻辑串行，单次任务结束后才可以使用相同信息下发第二次任务，请注意规避任务阻塞\n      fastregisterweapp-create: /cgi-bin/component/fastregisterweapp?action=create&component_access_token={ACCESS_TOKEN}\n      # 查询创建任务状态 该接口只提供当下任务结果查询，不建议过分依赖该接口查询所创建小程序\n      fastregisterweapp-search: /cgi-bin/component/fastregisterweapp?action=search&component_access_token={ACCESS_TOKEN}\n      # 小程序名称检测 调用本 API 可以检测微信认证的名称是否符合规则\n      check-nickname: /cgi-bin/wxverify/checkwxverifynickname?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置小程序名称 调用本接口可以设置小程序名称，当名称没有命中关键词，则直接设置成功；当名称命中关键词，需提交证明材料，并需要审核。审核结果会向消息与事件接收 URL 进行事件推送\n      set-nickname: /wxa/setnickname?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询小程序名称审核状态 调用设置名称接口，如果需要审核，会返回审核单 id（audit_id）,使用本接口可以查询改名审核状态\n      query-nickname-status: /wxa/api_wxa_querynickname?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置小程序介绍 调用本接口可以修改功能介绍。报错53204请注意： 1、signature长度4~120。 2、signature至少4个字的中文描述。\n      modify-signature: /cgi-bin/account/modifysignature?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 修改头像 调用本接口可以修改小程序的头像\n      modify-head-image: /cgi-bin/account/modifyheadimage?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 配置小程序服务器域名 授权给第三方的小程序，其服务器域名只可以为在第三方平台账号中配置的小程序服务器域名，当小程序通过第三方平台发布代码上线后，小程序原先自己配置的服务器域名将被删除，只保留第三方平台的域名，所以第三方平台在代替小程序发布代码之前，需要调用接口为小程序添加第三方平台自身的域名\n      modify-server-domain: /wxa/modify_domain?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置第三方平台服务器域名 授权给第三方代开发的小程序，其服务器域名只可以为在第三方平台账号中配置的小程序服务器域名。即调用接口设置小程序服务器域名之前可以调本接口先进行第三方平台小程序服务器域名配置\n      modify-thirdparty-server-domain: /cgi-bin/component/modify_wxa_server_domain?access_token={ACCESS_TOKEN}\n      # 获取草稿箱列表 通过本接口，可以获取第三方平台草稿箱中所有的草稿\n      templated-raft-list: /wxa/gettemplatedraftlist?access_token={ACCESS_TOKEN}\n      # 将草稿添加到模板库 接口用于将草稿添加到模板库设置为持久的代码模板\n      add-to-template: /wxa/addtotemplate?access_token={ACCESS_TOKEN}\n      # 获取模板列表 通过该接口可以获取模板库里的模板列表信息\n      template-list: /wxa/gettemplatelist?access_token={ACCESS_TOKEN}\n      # 删除代码模板 通过该接口可以删除指定的模板。因为代码模板库的模板数量是有上限的，当达到上限或者有某个模板不再需要时，建议调用本接口删除指定的代码模板\n      delete-template: /wxa/deletetemplate?access_token={ACCESS_TOKEN}\n      # 小程序登录 第三方平台开发者的服务器使用登录凭证code以及第三方平台的 component_access_token 可以代替小程序实现登录功能 获取 session_key 和 openid。\n      thirdparty-code-2-session: /sns/component/jscode2session?grant_type=authorization_code&component_appid={COMPONENT_APPID}&appid={APPID}&js_code={JSCODE}&component_access_token={ACCESS_TOKEN}\n      # 绑定体验者 第三方平台在帮助旗下授权的小程序提交代码审核之前，可先让小程序运营者体验，体验之前需要将运营者的个人微信号添加到该小程序的体验者名单中\n      bind-tester: /wxa/bind_tester?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 解除绑定体验者 调用本接口可以将特定微信用户从小程序的体验者列表中解绑\n      unbind-tester: /wxa/unbind_tester?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取体验者列表 通过本接口可以获取小程序所有已绑定的体验者列表\n      tester: /wxa/memberauth?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传代码并生成体验版 第三方平台需要先通过addToTemplate接口将草稿添加到代码模板库，然后从代码模板库中通过getTemplateList接口获取对应的模板 id（template_id），然后调用本接口可以为已授权的小程序上传代码并生成体验版\n      code-commit: /wxa/commit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取已上传的代码页面列表 通过本接口可以获取由commit接口上传代码的页面列表\n      code-page: /wxa/get_page?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取体验版二维码 调用本接口可以获取小程序的体验版二维码\n      trial-qr-code: /wxa/get_qrcode?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 提交代码审核 在调用commit为小程序上传代码后，可以调用本接口，将上传的代码提交审核\n      code-submit-audit: /wxa/submit_audit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 加急代码审核 有加急次数的第三方可以通过该接口，对已经提审的小程序进行加急操作，加急后的小程序预计2-12小时内审完。但是若代码中包含较复杂逻辑或其他特殊情况，可能会导致审核时间延长\n      speedup-code-audit: /wxa/speedupaudit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询审核单状态 通过接口提交审核后，调用本接口可以查询指定发布审核单的审核状态\n      code-audit-status: /wxa/get_auditstatus?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询最新一次审核单状态 调用本接口可以查询最新一次提审单的审核状态\n      code-latest-audit-status: /wxa/get_latest_auditstatus?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 撤回代码审核 调用本接口可以撤回当前的代码审核单\n      code-undo-audit: /wxa/undocodeaudit?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 发布已通过审核的小程序\n      code-release: /wxa/release?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 小程序版本回退 调用本接口可以将小程序的线上版本进行回退\n      revert-code-release: /wxa/revertcoderelease?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取可回退的小程序版本\n      code-release-history: /wxa/revertcoderelease?action=get_history_version&access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传提审素材 调用本接口可将小程序页面截图和操作录屏上传，提审时带上相关参数，可以帮助审核人员判断\n      upload-media-to-code-audit: /wxa/uploadmedia?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询小程序版本信息 调用本接口可以查询小程序的体验版和线上版本信息,如果需要查询审核中版本信息可通过getLatestAuditStatus接口获取.\n      version-info: /wxa/getversioninfo?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询最新一次审核单状态 调用本接口可以查询最新一次提审单的审核状态\n      latest-audit-status: /wxa/get_latest_auditstatus?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取可设置的所有类目 本接口可以获取该小程序允许设置的所有类目且仅支持获取一级类目和二级类目，注意不同主体所允许设置的类目不同\n      all-categories: /cgi-bin/wxopen/getallcategories?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取已设置的所有类目 使用本接口获取小程序已设置的所有类目\n      setting-categories: /cgi-bin/wxopen/getcategory?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 添加类目 调用本接口可以给小程序添加类目，添加的类目需要在所有可设置的类目列表中\n      add_category: /cgi-bin/wxopen/addcategory?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 删除类目 调用本接口可以删除小程序的指定类目\n      delete-category: /cgi-bin/wxopen/deletecategory?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取类目名称信息 接口可获取已设置的二级类目及用于代码审核的可选三级类目\n      all-category-name: /wxa/get_category?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 设置小程序用户隐私保护指引 本接口用于配置第三方代开发小程序的用户隐私保护指引。可根据小程序实际情况进行完善。小程序发布后即向c端用户展示。\n      privacy-setting-set: /cgi-bin/component/setprivacysetting?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序用户隐私保护指引 本接口用于查询第三方代开发小程序的用户隐私保护指引，也可以用来查询有哪些privacy_key可以进行配置。\n      privacy-setting-get: /cgi-bin/component/getprivacysetting?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传小程序用户隐私保护指引 本接口用于上传自定义的小程序的用户隐私保护指引。\n      upload-privacy-setting: /cgi-bin/component/uploadprivacyextfile?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 发起小程序管理员人脸核身,调用该接口时会向 access_token 所指定的小程序的管理员发送一条备案人脸核身通知，管理员点击该通知即可进行人脸核身。待管理员完成核身之后，平台会推送人脸核身完成事件到服务商服务器，服务商也可以使用查询人脸核身任务状态接口来轮询任务状态和结果。\n      create-icp-verify-task: /wxa/icp/create_icp_verifytask?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 查询人脸核身任务状态 该接口用于查询人脸核身任务的状态和结果\n      query-icp-verify-task: /wxa/icp/query_icp_verifytask?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 上传小程序备案媒体材料 备案小程序需要提交图片或视频媒体材料，使用该接口完成媒体材料上传\n      upload-icp-media: /wxa/icp/upload_icp_media?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 申请小程序备案 该接口使用的媒体材料都是通过\"上传小程序备案媒体材料\"接口返回的media_id\n      apply-icp-filing: /wxa/icp/apply_icp_filing?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 撤回小程序备案申请 使用该接口撤回正在流程中的备案申请。\n      cancel-apply-icp-filing: /wxa/icp/cancel_apply_icp_filing?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序备案状态及驳回原因 使用该接口获取小程序备案状态，如果小程序未备案通过，则返回其驳回原因。\n      get-icp-entrance-info: /wxa/icp/get_icp_entrance_info?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序已备案详情\n      get-online-icp-order: /wxa/icp/get_online_icp_order?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取小程序服务内容类型\n      query-icp-service-content-types: /wxa/icp/query_icp_service_content_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取证件类型\n      query-icp-certificate-types: /wxa/icp/query_icp_certificate_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取区域信息 使用该接口查询省市区的区域信息。\n      query-icp-district-code: /wxa/icp/query_icp_district_code?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取前置审批项类型 使用该接口获取小程序备案前置审批项类型定义。\n      query-icp-nrlx-types: /wxa/icp/query_icp_nrlx_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 获取单位性质\n      query-icp-subject-types: /wxa/icp/query_icp_subject_types?access_token={AUTHORIZER_ACCESS_TOKEN}\n      # 注销小程序备案 1.注销备案不能被撤回。2.注销备案时工信部会给主体负责人或小程序负责人（取决于注销类型）下发一条验证短信，如果想终止注销流程，忽略该条短信即可。\n      cancel-icpfiling: /wxa/icp/cancel_icp_filing?access_token={AUTHORIZER_ACCESS_TOKEN}','1633ba12653389378feb8874c0a6b1b7','2023-08-29 07:33:59','2023-11-27 03:20:06','nacos','172.16.85.134','','prod','','','','yaml','',''),(6470,'solution-config.yml','DEFAULT_GROUP','solution:\n  ppt:\n    file-max-count: 20\n    product-max-num: 50\n  excel:\n    file-max-count: 20\n    product-max-num: 100','5e4581ca21a06385a250a00c4710a9f3','2023-09-04 03:46:13','2023-09-04 05:49:56','nacos','172.16.85.166','','dev','方案车配置','','','yaml','',''),(6471,'solution-config','DEFAULT_GROUP','solution:\n  ppt:\n    file-max-count: 20\n    product-max-num: 50\n  excel:\n    file-max-count: 20\n    product-max-num: 100','5e4581ca21a06385a250a00c4710a9f3','2023-09-04 03:51:37','2023-09-04 05:49:42','nacos','172.16.85.166','','prod','方案车配置','','','yaml','',''),(9368,'aliyun-key-domain-config.yml','DEFAULT_GROUP','aliyun:\n  access-key:\n    config:\n      access-key: LTAI5tPdouYjAJRfMLrU5wXv\n      secret-key: rOtlLqBBdGXKmcM3ZPhFnNZOMNXJy8','d1e97abe3eab0fb02f3932e7eabfac1d','2023-09-25 06:27:59','2023-09-25 06:27:59',NULL,'172.16.85.134','','dev',NULL,NULL,NULL,'yaml',NULL,''),(9369,'aliyun-key-domain-config.yml','DEFAULT_GROUP','aliyun:\n  access-key:\n    config:\n      access-key: LTAI5tPdouYjAJRfMLrU5wXv\n      secret-key: rOtlLqBBdGXKmcM3ZPhFnNZOMNXJy8','d1e97abe3eab0fb02f3932e7eabfac1d','2023-09-25 06:28:15','2023-09-25 06:28:15',NULL,'172.16.85.134','','prod',NULL,NULL,NULL,'yaml',NULL,''),(9598,'pay-lianlian-config.yml','DEFAULT_GROUP','pay:\n  lianlian:\n    # 商户号 连连支付提供\n    oid_partner: 2022070704790692\n    # 编码格式\n    char-set: UTF-8\n    # 签名加密方式\n    sign-method: RSA\n    #商户私钥地址\n    mer-private-key-path: .pinmai/lianlianpay/cert/prod/merchant_rsa_private_key.txt\n    #连连公钥地址\n    llpay-public-key-path: .pinmai/lianlianpay/cert/prod/llpay_public_key.pem\n    # （异步）支付完成后，账单系统收到通知后会组织结果信息发送通知到商户的通知地址\n    notify-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/notify\n    # （异步）退款完成后，账单系统收到通知后会组织结果信息发送通知到商户的通知地址\n    refund-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/refund\n    # （异步）代金券退款完成后，账单系统收到通知后会组织结果信息发送通知到商户的通知地址\n    voucher-refund-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/refund/voucher\n    # （异步）支付完成后通知(充值)\n    recharge-notify-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/recharge/notify\n    # （异步）支付完成后通知(购买代金券)\n    voucher-notify-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/voucher/notify\n    # （异步）支付完成后通知(来账宝)\n    lzb-notify-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/lzb/notify\n    # （异步）支付完成后通知(内部代发)\n    nbdf-notify-url: https://juru.prod.jrmall.cn/api/admin/payment/callback/lianlianpay/nbdf/notify\n    # （异步）开户申请异步通知\n    openacct-notify-url: https://juru.prod.jrmall.cn/api/admin/account/callback/lianlianpay/openacctNotify\n    # （异步）开户申请异步通知\n    agree-notify-url: https://juru.prod.jrmall.cn/api/admin/account/callback/lianlianpay/agreeNotify\n    # 交易完成回跳页面地址，H5/PC渠道必传\n    agree-return-url: https://juru.prod.jrmall.cn/index.html\n    # （异步）提现申请异步通知\n    withdrawal-notify-url: https://juru.prod.jrmall.cn/api/admin/account/callback/lianlianpay/withdrawalNotify\n    # 协议(默认使用HTTPS)\n    protocol: https\n    # 连连支付域名\n    domain: accpapi.lianlianpay.com\n    # 文件上传域名\n    file-domain: accpfile.lianlianpay.com\n    # 余额委托交易的协议授权域名，线下交易也用\n    agree-domain: accpgw.lianlianpay.com\n    # 使用商户号作为来源\n    source-no: LL92\n    api:\n      # 支付统一创单\n      create: /v1/txn/tradecreate\n      # 连连网关类支付\n      netpay: /v1/txn/payment-gw\n      # 连连来帐宝支付\n      lzb: /v1/lzb/init-lzb\n      # 支付结果查询\n      query: /v1/txn/query-payment\n      # 退款接口\n      refund: /v1/txn/more-payee-refund\n      # 退款查询接口\n      refund-query: /v1/txn/query-refund\n      # 关闭订单\n      trade-close: /v1/txn/close-payment\n      #余额支付\n      balance-pay: /v1/txn/payment-balance\n      #内部代发申请 用户/平台商户A将账户可用余额代发至用户/平台商户B可用余额账户，收款方可传多个，业务场景为佣金代发、红包奖励代发、供应商货款付款等。\n      transfer-morepyee: /v1/txn/transfer-morepyee\n      #交易二次短信验证\n      validation-sms: /v1/txn/validation-sms\n      #账户信息查询 该接口提供绑定合作银行账户、账户号、账户状态和余额等查询功能。\n      query-acctinfo: /v1/acctmgr/query-acctinfo\n      # 用户信息查询 该接口提供用户编号、用户状态、合作银行账号和银行开户状态等查询功能。\n      query-userinfo: /v1/acctmgr/query-userinfo\n      # 修改支付密码\n      change-password: /v1/acctmgr/change-password\n      #找回支付密码申请 用户忘记密码或者输错密码次数过多被锁定可以通过找回密码解决\n      find-password-apply: /v1/acctmgr/find-password-apply\n      #找回支付密码验证\n      find-password-verify: /v1/acctmgr/find-password-verify\n      #绑定手机验证码申请,调用开户接口前，需要调用绑定手机验证码申请和验证接口验证账户绑定手机号\n      regphone-verifycode-apply: /v1/acctmgr/regphone-verifycode-apply\n      #绑定手机验证码验证,此接口用于验证账户绑定手机号收到的短信验证码。\n      regphone-verifycode-verify: /v1/acctmgr/regphone-verifycode-verify\n      #企业用户开户申请\n      openacct-apply-enterprise: /v1/acctmgr/openacct-apply-enterprise\n      #企业用户开户验证,企业用户开户绑定法人银行卡时，调用此接口验证绑卡验证短信和设置交易密码。\n      openacct-verify-enterprise: /v1/acctmgr/openacct-verify-enterprise\n      #大额行号查询 该接口提供查询银行支行大额行号的功能，代发接口收款方是对公户时会用到。\n      query-cnapscode: /v1/acctmgr/query-cnapscode\n      #该接口用于上传图片或者文件，获得doc_id\n      upload: /v1/documents/upload\n      #随机因子获取 因密码不能明文传输，需要用密码控件加密密码，加解密的随机因子用此接口申请。\n      random: /v1/acctmgr/get-random\n      #协议申请(免密提现申请) 此接口用于用户发起对某个客户的余额委托交易的协议授权。\n      pap-agree-apply: /v1/txn/pap-agree-apply\n      # 协议修改 此接口用于用户发起对已有协议的修改\n      pap-agree-modify: /v1/txn/pap-agree-modify\n      #协议关闭 此接口用于对委托协议进行撤销。\n      pap-agree-invalid: /v1/txn/pap-agree-invalid\n      #协议单条查询 此接口用于查询指定用户已签约的协议\n      pap-agree-query: /v1/txn/pap-agree-query\n      #协议分页查询 此接口用于查询指定用户已签约的协议列表\n      pap-agree-pagequery: /v1/txn/pap-agree-pagequery\n      #提现申请 用户或商户将账户可用余额提现到开户时绑定的银行卡中，只能提现到本人卡。验证方式：支付密码+短信验证码。短验验证注册绑定手机号。\n      withdrawal: /v1/txn/withdrawal\n      #该接口提供所有提现场景下的订单查询，包括提现及代发到银行账户；商户可以通过该接口主动查询订单状态，完成下一步的业务逻辑\n      query-withdrawal: /v1/txn/query-withdrawal\n      #电子回单生成 对于支付类、提现类、退款类的交易可以生成回单，生成时间预计耗时5~10分钟。业务规则：只支持1年以内的交易回单生成申请；\n      receipt-produce: /v1/offlinetxn/receipt-produce\n      #电子回单下载 商户调用电子回单接口完成回单申请后调用。限制规则：同一个商户订单的回单最多只允许下载五次，对于首次已经成功生成下载后的回单，商户侧应该自行进行本地存储处理\n      receipt-download: /v1/offlinetxn/receipt-download\n      #用户等级修改 用户开户成功后，可以调用此接口修改用户等级。\n      update-account-level: /v1/acctmgr/modify-user-level','3ec46496f2faa517a55406a5ca272cf5','2023-09-26 06:43:53','2023-09-26 06:57:15','nacos','172.16.85.134','','prod','连连支付配置','','','yaml','',''),(9604,'pay-lianlian-config.yml','PAY_GROUP','pay:\n  lianlian:\n    # 商户号 连连支付提供\n    oid_partner: 2022070704790692\n    # 编码格式\n    char-set: UTF-8\n    # 签名加密方式\n    sign-method: RSA\n    #商户私钥地址\n    mer-private-key-path: .pinmai/lianlianpay/cert/prod/merchant_rsa_private_key.txt\n    #连连公钥地址\n    llpay-public-key-path: .pinmai/lianlianpay/cert/p