n\":\"hessian2,fastjson2\",\"shutwait\":\"16000\",\"dynamic\":\"true\",\"service.filter\":\"providerRpcFilter\",\"REGISTRY_CLUSTER\":\"default:dubbo-dev\"},\"path\":\"com.jrmall.pilates.system.api.RoleApi\",\"port\":20880,\"protocol\":\"dubbo\"}}}','5a66780b7618251f097fa24ca920c360','2025-06-09 17:39:21','2025-06-12 10:39:23',NULL,'172.16.85.134','','dubbo-metadata-dev',NULL,NULL,NULL,'text',NULL,''),(21351,'mysql-system-config.yml','DEFAULT_GROUP','spring: \n  datasource:\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB_NAME:youlai_system}?useUnicode=true&useSSL=false&characterEncoding=utf8&serverTimezone=PRC\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.alibaba.druid.pool.DruidDataSource\n    username: ${MYSQL_USERNAME}\n    password: ${MYSQL_PASSWORD}\n    druid:\n      # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n      connection-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=500\n      # 初始化时建立物理连接的个数\n      initial-size: 5\n      # 最小连接池数量\n      min-idle: 5\n      # 最大连接池数量\n      max-active: 100\n      # 获取连接时最大等待时间，单位毫秒\n      max-wait: 60000\n      # 要启用PSCache，必须配置大于0，当大于0时，poolPreparedStatements自动触发修改为true。\n      max-pool-prepared-statement-per-connection-size: 0\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      min-evictable-idle-time-millis: 300000\n      # 是否缓存preparedStatement，也就是PSCache。PSCache对支持游标的数据库性能提升巨大，比如说oracle。在mysql下建议关闭。\n      pool-prepared-statements: false\n      # 申请连接时执行validationQuery检测连接是否有效，做了这个配置会降低性能。\n      test-on-borrow: false\n      # 归还连接时执行validationQuery检测连接是否有效，做了这个配置会降低性能。\n      test-on-return: false\n      # 建议配置为true，不影响性能，并且保证安全性。申请连接的时候检测，如果空闲时间大于timeBetweenEvictionRunsMillis，执行validationQuery检测连接是否有效。\n      test-while-idle: true\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      time-between-eviction-runs-millis: 60000\n      # 合并多个DruidDataSource的监控数据\n      use-global-data-source-stat: true\n      # 用来检测连接是否有效的sql，要求是一个查询语句\n      validation-query: SELECT 1\n      # Spring 监控，利用aop 对指定接口的执行时间，jdbc数进行记录\n      #aop-patterns: \'com.jrmall.stock.*, com.jrmall.sys.*\'\n      ########## 配置StatViewServlet（监控页面），用于展示Druid的统计信息 ##########\n      stat-view-servlet: #监控页配置\n        # 启用StatViewServlet\n        enabled: true\n        # 访问内置监控页面的路径，内置监控页面的首页是/druid/index.html\n        url-pattern: /druid/*\n        # 配置监控页面访问密码\n        login-username: juru\n        login-password: juru2013\n        # 不允许清空统计数据,重新计算\n        reset-enable: false\n        # 允许访问的地址，如果allow没有配置或者为空，则允许所有访问\n        #allow:\n        # 拒绝访问的地址，deny优先于allow，如果在deny列表中，就算在allow列表中，也会被拒绝\n        #deny:\n      ########## 配置WebStatFilter，用于采集web关联监控的数据 ##########\n      web-stat-filter: # web监控\n        enabled: true\n        url-pattern: /*\n        exclusions: \'*.html,*.js,*.map,*.ts,*.css,*.mp3,*.gif,*.jpg,*.png,*.ico,*.svg,*.woff2,/druid/*\'\n        # 开启session统计功能\n        session-stat-enable: true\n        # session的最大个数,默认100\n        session-stat-max-count: 1000\n      ########### 启用内置过滤器（第一个 stat必须，否则监控不到SQL）##########\n      filters: stat,wall,log4j2\n      filter:\n        stat: # sql监控统计\n          enabled: true\n          log-slow-sql: true\n          slow-sql-millis: 10000\n          merge-sql: true\n\nmybatis-plus:\n  configuration:\n    # 驼峰下划线转换\n    map-underscore-to-camel-case: true\n    # 这个配置会将执行的sql完整打印出来，包括查询返回结果，不打开下面配置不打印查询结果，在开发或测试的时候可以用\n    # log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n    default-enum-type-handler: org.apache.ibatis.type.EnumOrdinalTypeHandler','f3cf9a845a8c3ab0d97cf63d41f60172','2025-06-10 13:40:56','2025-06-10 14:33:09','nacos','0:0:0:0:0:0:0:1','','pilates-cloud-dev','',NULL,NULL,'yaml',NULL,''),(21352,'mysql-auth-config.yml','DEFAULT_GROUP','spring: \n  datasource:\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB_NAME:oauth2_server}?useUnicode=true&useSSL=false&characterEncoding=utf8&serverTimezone=PRC\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: co