ter: alpha\n  api-docs:\n    path: /v3/api-docs\n  group-configs:\n    - group: \'default\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.youlai.auth.controller\n  # Api文档信息\n  info:\n    title: 认证服务\n    version: 3.0.0\n    description: 认证、登出、验证码接口\n    contact:\n      name: youlai\n      url: https://www.youlai.tech\n      email: youlaitech@163.com\n    license:\n      name: Apache 2.0\n      url: https://www.apache.org/licenses/LICENSE-2.0.html\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  enable: false\n  setting:\n    language: zh_cn\n\n# 验证码配置\ncaptcha:\n  # 验证码类型 circle-圆圈干扰验证码|gif-Gif验证码|line-干扰线验证码|shear-扭曲干扰验证码\n  type: circle\n  # 验证码宽度\n  width: 120\n  # 验证码高度\n  height: 40\n  # 验证码干扰元素个数\n  interfere-count: 2\n  # 文本透明度(0.0-1.0)\n  text-alpha: 0.8\n  # 验证码字符配置\n  code:\n    # 验证码字符类型 math-算术|random-随机字符\n    type: math\n    # 验证码字符长度，type=算术时，表示运算位数(1:个位数运算 2:十位数运算)；type=随机字符时，表示字符个数\n    length: 1\n  # 验证码字体\n  font:\n    # 字体名称 Dialog|DialogInput|Monospaced|Serif|SansSerif\n    name: SansSerif\n    # 字体样式 0-普通|1-粗体|2-斜体\n    weight: 1\n    # 字体大小\n    size: 24\n  # 验证码有效期(秒)\n  expire-seconds: 120\n','eb193b76bdc384d889f0d8ae7f179c63','2025-06-05 09:24:25','2025-06-05 01:24:25','nacos','0:0:0:0:0:0:0:1','I','pilates-cloud-dev','','formal','','{\"src_user\":\"nacos\",\"type\":\"yaml\"}'),(0,35,'pilates-common.yaml','DEFAULT_GROUP','','redis:\n  database: 0\n  host: 47.99.167.239\n  port: 6379\n  password: pnKnJjjWchNehRRc\n  \nmysql:\n  host: 47.99.167.239\n  port: 3306\n  username: youlai_cloud\n  password: S4DKt3wcYT2mLNAc\n\nrabbitmq:\n  host: localhost\n  port: 5672\n  username: admin\n  password: admin\n  \n# 验签公钥地址\nspring:\n  security:\n    oauth2:\n      authorizationserver:\n        token-uri: http://localhost:9999/youlai-auth/oauth2/token\n      resourceserver:\n        jwt:\n          # issuer-uri: http://127.0.0.1:9000\n          jwk-set-uri: http://localhost:9999/youlai-auth/oauth2/jwks\n\n# 短信配置\nsms:\n  # 阿里云短信\n  aliyun:\n    a