 name: Apache 2.0\n      url: https://www.apache.org/licenses/LICENSE-2.0.html\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  enable: false\n  setting:\n    language: zh_cn\n\n# 验证码配置\ncaptcha:\n  # 验证码类型 circle-圆圈干扰验证码|gif-Gif验证码|line-干扰线验证码|shear-扭曲干扰验证码\n  type: circle\n  # 验证码宽度\n  width: 120\n  # 验证码高度\n  height: 40\n  # 验证码干扰元素个数\n  interfere-count: 2\n  # 文本透明度(0.0-1.0)\n  text-alpha: 0.8\n  # 验证码字符配置\n  code:\n    # 验证码字符类型 math-算术|random-随机字符\n    type: math\n    # 验证码字符长度，type=算术时，表示运算位数(1:个位数运算 2:十位数运算)；type=随机字符时，表示字符个数\n    length: 1\n  # 验证码字体\n  font:\n    # 字体名称 Dialog|DialogInput|Monospaced|Serif|SansSerif\n    name: SansSerif\n    # 字体样式 0-普通|1-粗体|2-斜体\n    weight: 1\n    # 字体大小\n    size: 24\n  # 验证码有效期(秒)\n  expire-seconds: 120\n','eb193b76bdc384d889f0d8ae7f179c63','2025-06-10 09:09:02','2025-06-10 01:09:03','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21311,121,'pilates-gateway.yaml','DEFAULT_GROUP','','spring:\n  data:\n    redis:\n      timeout: PT30S\n      database: ${redis.database}\n      host: ${redis.host}\n      port: ${redis.port}\n      password: ${redis.password}\n      lettuce:\n        pool:\n          # 连接池最小空闲连接数\n          min-idle: 1\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          enabled: true # 启用服务发现\n          lower-case-service-id: true\n      default-filters:\n        # 令牌中继\n        - TokenRelay= \n      routes:\n        - id: 认证中心\n          uri: lb://pilates-auth\n          predicates:\n            - Path=/pilates-auth/**\n          filters:\n            - StripPrefix=1            \n        - id: 系统服务\n          uri: lb://pilates-system-boot\n          predicates:\n            - Path=/pilates-system-boot/**\n          filters:\n            - StripPrefix=1            \n      globalcors:\n        corsConfigurations:\n          \'[/**]\': # 对所有路由应用CORS配置\n            # 允许所有域名的请求\n            allowedOriginPatterns: \"*\"\n            # 允许所有