nacos\"}'),(21315,181,'redis-config.yml','DEFAULT_GROUP','','spring:\n  redis:\n    password: xhndmm86huyn\n    host: 172.16.85.105\n    port: 6379\n    timeout: 30000 # 连接超时时间（毫秒）\n    database: 0\n    jedis:\n      pool:\n        max-active: 30 # 连接池最大连接数（使用负值表示没有限制）\n        max-wait: 20000 # 连接池最大阻塞等待时间（使用负值表示没有限制）\n        max-idle: 30 # 连接池中的最大空闲连接\n        min-idle: 5 # 连接池中的最小空闲连接\n        time-between-eviction-runs: -1 #逐出扫描的时间间隔(毫秒) 如果为负数,则不运行逐出线程, 默认-1','c8a4ac226210bcf473fe9dd3b83875f4','2025-06-10 13:51:31','2025-06-10 05:51:29','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21315,182,'redis-config.yml','DEFAULT_GROUP','','spring:\n  data:\n    redis:\n      password: ${REDIS_PASSWORD:}\n      host: ${REDIS_HOST:127.0.0.1}\n      port: ${REDIS_PROT:6379}\n      timeout: 30000 # 读取超时时间（毫秒）\n      connect-timeout: 30000 #连接超时时间（毫秒）\n      database: ${REDIS_DB:15}\n      health-check: true # 是否开启健康检查(RedisHealthCheck.class)\n      lettuce:\n        pool:\n          enabled: true\n          max-active: 30 # 连接池最大连接数（使用负值表示没有限制）\n          max-wait: 20000 # 连接池最大阻塞等待时间（使用负值表示没有限制）\n          max-idle: 10 # 连接池中的最大空闲连接\n          min-idle: 5 # 连接池中的最小空闲连接\n          time-between-eviction-runs: -1 #逐出扫描的时间间隔(毫秒) 如果为负数,则不运行逐出线程, 默认-1','98696d2178d193bbf14cafb65b2c80cc','2025-06-10 13:52:11','2025-06-10 05:52:09','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21314,183,'knife4j-gateway-config.yml','DEFAULT_GROUP','','knife4j:\n  gateway:\n    enabled: true\n    strategy: discover\n    discover:\n      enabled: true\n      excluded-services:\n        - gateway\n      service-config:\n        auth:\n          group-name: 认证服务\n          order: 1\n        system:\n          group-name: 系统管理\n          order: 2\n','1e92b09480c439cecd9c464012827126','2025-06-10 13:53:45','2025-06-10 05:53:43','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21312,184,'pilates-system.yaml','DEFAULT_GROUP','','spring:\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver \n    url: jdbc:mysql://${mysql.host}:${mysql.port}/youlai_system?zeroDateTimeBehavior=convertToNull&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&autoReconnect=true\n    username: ${mysql.username}\n    password: ${mysql.password}\n  data:\n    redis:\n      database: ${redis.database}\n      host: ${redis.host}\n      port: ${redis.port}\n      password: ${redis.password}\n      lettuce:\n        pool:\n          min-idle: 1\n  # RabbitMQ 配置\n  rabbitmq:\n    host: ${rabbitmq.host}\n    port: ${rabbitmq.port}\n    username: ${rabbitmq.username}\n    password: ${rabbitmq.password}\n    virtual-host: /\n    listener:\n      simple:\n        acknowledge-mode: manual   \n  cache:\n    # 缓存类型 redis、none(不使用缓存) \n    type: redis\n    # 缓存时间(单位：ms)\n    redis:\n      time-to-live: 3600000\n      # 缓存null值，防止缓存穿透\n      cache-null-values: true\n\n                \nmybatis-plus:\n  configuration:\n    # 驼峰下划线转换\n    map-underscore-to-camel-case: true\n    # 这个配置会将执行的sql完整打印出来，包括查询返回结果，不打开下面配置不打印查询结果，在开发或测试的时候可以用\n    # log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n    default-enum-type-handler: org.apache.ibatis.type.EnumOrdinalTypeHandler\n\n# 安全配置\nsecurity:\n  # 允许无需认证的路径列表\n  whitelist-paths:\n    # 获取系统用户的认证信息用于账号密码判读\n    - /api/v1/users/{username}/authInfo\n\n\n# 文件存储\noss:\n  # OSS 类型 (目前支持aliyun、minio)\n  type: aliyun\n  # MinIO 对象存储服务\n  minio:\n    # 服务Endpoint\n    endpoint: http://localhost:9000\n    # 访问凭据\n    access-key: minioadmin\n    # 凭据密钥\n    secret-key: minioadmin\n    # 存储桶名称\n    bucket-name: default\n    # (可选)自定义域名，如果配置了域名，生成的文件URL是域名格式，未配置则URL则是IP格式 (eg: https://oss.youlai.tech)\n    custom-domain:\n  # 阿里云OSS对象存储服务\n  aliyun:\n    # 服务Endpoint\n    endpoint: oss-cn-hangzhou.aliyuncs.com\n    # 访问凭据\n    access-key-id: your-access-key-id\n    # 凭据密钥\n    access-key-secret: your-access-key-secret\n    # 存储桶名称\n    bucket-name: default\n','c0fb5e41d095fc913d3e673552ae4d64','2025-06-10 13:58:28','2025-06-10 05:58:27','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21312,185,'pilates-system.yaml','DEFAULT_GROUP','','    \nmybatis-plus:\n  configuration:\n    # 驼峰下划线转换\n    map-underscore-to-camel-case: true\n    # 这个配置会将执行的sql完整打印出来，包括查询返回结果，不打开下面配置不打印查询结果，在开发或测试的时候可以用\n    # log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n    default-enum-type-handler: org.apache.ibatis.type.EnumOrdinalTypeHandler\n\n# 安全配置\nsecurity:\n  # 允许无需认证的路径列表\n  whitelist-paths:\n    # 获取系统用户的认证信息用于账号密码判读\n    - /api/v1/users/{username}/authInfo\n\n\n','4968bbc73d8607849e3389fd11568d27','2025-06-10 14:01:06','2025-06-10 06:01:05','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21351,186,'mysql-system-config.yml','DEFAULT_GROUP','','spring: \n    #  数据库配置\n  datasource:\n    druid:\n      url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB_NAME:youlai_system}?useUnicode=true&useSSL=false&characterEncoding=utf8&serverTimezone=PRC\n      driver-class-name: com.mysql.cj.jdbc.Driver\n      username: ${MYSQL_USERNAME}\n      password: ${MYSQL_PASSWORD}\n      # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n      connection-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=500\n      # 初始化时建立物理连接的个数\n      initial-size: 5\n      # 最小连接池数量\n      min-idle: 5\n      # 最大连接池数量\n      max-active: 100\n      # 获取连接时最大等待时间，单位毫秒\n      max-wait: 60000\n      # 要启用PSCache，必须配置大于0，当大于0时，poolPreparedStatements自动触发修改为true。\n      max-pool-prepared-statement-per-connection-size: 0\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      min-evictable-idle-time-millis: 300000\n      # 是否缓存preparedStatement，也就是PSCache。PSCache对支持游标的数据库性能提升巨大，比如说oracle。在mysql下建议关闭。\n      pool-prepared-statements: false\n      # 申请连接时执行validationQuery检测连接是否有效，做了这个配置会降低性能。\n      test-on-borrow: false\n      # 归还连接时执行validationQuery检测连接是否有效，做了这个配置会降低性能。\n      test-on-return: false\n      # 建议配置为true，不影响性能，并且保证安全性。申请连接的时候检测，如果空闲时间大于timeBetweenEvictionRunsMillis，执行validationQuery检测连接是否有效。\n      test-while-idle: true\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      time-between-eviction-runs-millis: 60000\n      # 合并多个DruidDataSource的监控数据\n      use-global-data-source-stat: true\n      # 用来检测连接是否有效的sql，要求是一个查询语句\n      validation-query: SELECT 1\n      # Spring 监控，利用aop 对指定接口的执行时间，jdbc数进行记录\n      #aop-patterns: \'com.jrmall.stock.*, com.jrmall.sys.*\'\n      ########## 配置StatViewServlet（监控页面），用于展示Druid的统计信息 ##########\n      stat-view-servlet: #监控页配置\n        # 启用StatViewServlet\n        enabled: true\n        # 访问内置监控页面的路径，内置监控页面的首页是/druid/index.html\n        url-pattern: /druid/*\n        # 配置监控页面访问密码\n        login-username: juru\n        login-password: juru2013\n        # 不允许清空统计数据,重新计算\n        reset-enable: false\n        # 允许访问的地址，如果allow没有配置或者为空，则允许所有访问\n        #allow:\n        # 拒绝访问的地址，deny优先于allow，如果在deny列表中，就算在allow列表中，也会被拒绝\n        #deny:\n      ########## 配置WebStatFilter，用于采集web关联监控的数据 ##########\n      web-stat-filter: # web监控\n        enabled: true\n        url-pattern: /*\n        exclusions: \'*.html,*.js,*.map,*.ts,*.css,*.mp3,*.gif,*.jpg,*.png,*.ico,*.svg,*.woff2,/druid/*\'\n        # 开启session统计功能\n        session-stat-enable: true\n        # session的最大个数,默认100\n        session-stat-max-count: 1000\n      ########### 启用内置过滤器（第一个 stat必须，否则监控不到SQL）##########\n      filters: stat,wall,log4j2\n      filter:\n        stat: # sql监控统计\n          enabled: true\n          log-slow-sql: true\n          slow-sql-millis: 10000\n          merge-sql: true','cfd5fe476e7313c2d7bfa57d388908ea','2025-06-10 14:11:24','2025-06-10 06:11:22','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\"