被拒绝\n        #deny:\n      ########## 配置WebStatFilter，用于采集web关联监控的数据 ##########\n      web-stat-filter: # web监控\n        enabled: true\n        url-pattern: /*\n        exclusions: \'*.html,*.js,*.map,*.ts,*.css,*.mp3,*.gif,*.jpg,*.png,*.ico,*.svg,*.woff2,/druid/*\'\n        # 开启session统计功能\n        session-stat-enable: true\n        # session的最大个数,默认100\n        session-stat-max-count: 1000\n      ########### 启用内置过滤器（第一个 stat必须，否则监控不到SQL）##########\n      filters: stat,wall,log4j2\n      filter:\n        stat: # sql监控统计\n          enabled: true\n          log-slow-sql: true\n          slow-sql-millis: 10000\n          merge-sql: true','c957ffdd81354237e54f3403ebc9cefd','2025-06-10 14:19:50','2025-06-10 06:19:48','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21312,197,'pilates-system.yaml','DEFAULT_GROUP','','    \nmybatis-plus:\n  configuration:\n    # 驼峰下划线转换\n    map-underscore-to-camel-case: true\n    # 这个配置会将执行的sql完整打印出来，包括查询返回结果，不打开下面配置不打印查询结果，在开发或测试的时候可以用\n    # log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n    default-enum-type-handler: org.apache.ibatis.type.EnumOrdinalTypeHandler\n\n# 安全配置\nsecurity:\n  # 允许无需认证的路径列表\n  whitelist-paths:\n    # 获取系统用户的认证信息用于账号密码判读\n    - /api/v1/users/{username}/authInfo\n\nlogging:\n  level:\n    com.youlai: debug\n    com.alibaba: info\n    org.apache.http: info\n    org.springframework.security.oauth2: trace\n  config: classpath:logback-spring.xml\n','79bcd09e916f37225d8b75eb8b3f59c9','2025-06-10 14:32:49','2025-06-10 06:32:47','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21351,198,'mysql-system-config.yml','DEFAULT_GROUP','','spring: \n  datasource:\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB_NAME:youlai_system}?useUnicode=true&useSSL=false&characterEncoding=utf8&serverTimezone=PRC\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.ali