b监控\n        enabled: true\n        url-pattern: /*\n        exclusions: \'*.html,*.js,*.map,*.ts,*.css,*.mp3,*.gif,*.jpg,*.png,*.ico,*.svg,*.woff2,/druid/*\'\n        # 开启session统计功能\n        session-stat-enable: true\n        # session的最大个数,默认100\n        session-stat-max-count: 1000\n      ########### 启用内置过滤器（第一个 stat必须，否则监控不到SQL）##########\n      filters: stat,wall,log4j2\n      filter:\n        stat: # sql监控统计\n          enabled: true\n          log-slow-sql: true\n          slow-sql-millis: 10000\n          merge-sql: true','c957ffdd81354237e54f3403ebc9cefd','2025-06-10 14:33:09','2025-06-10 06:33:07','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21352,199,'mysql-auth-config.yml','DEFAULT_GROUP','','spring: \n  datasource:\n    url: jdbc:mysql://${MYSQL_HOST:127.0.0.1}:${MYSQL_PORT:3306}/${MYSQL_DB_NAME:oauth2_server}?useUnicode=true&useSSL=false&characterEncoding=utf8&serverTimezone=PRC\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.alibaba.druid.pool.DruidDataSource\n    username: ${MYSQL_USERNAME}\n    password: ${MYSQL_PASSWORD}\n    druid:\n      # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n      connection-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=500\n      # 初始化时建立物理连接的个数\n      initial-size: 5\n      # 最小连接池数量\n      min-idle: 5\n      # 最大连接池数量\n      max-active: 100\n      # 获取连接时最大等待时间，单位毫秒\n      max-wait: 60000\n      # 要启用PSCache，必须配置大于0，当大于0时，poolPreparedStatements自动触发修改为true。\n      max-pool-prepared-statement-per-connection-size: 0\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      min-evictable-idle-time-millis: 300000\n      # 是否缓存preparedStatement，也就是PSCache。PSCache对支持游标的数据库性能提升巨大，比如说oracle。在mysql下建议关闭。\n      pool-prepared-statements: false\n      # 申请连接时执行validationQuery检测连接是否有效，做了这个配置会降低性能。\n      test-on-borrow: false\n      # 归还连接时执行validationQuery检测连接是否有效，做了这个配置会降低性能。\n      test-on-return: false\n      # 建议配置为true，不影响性能，并且保证安全性。申请连接的时候检测，如果空闲时间大于timeBetweenEvictionRunsMillis，执行validationQuery检测连接是否有效。\n      test-while-idle: true\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      time-between-eviction-runs-millis: 60000\n      # 合并多个DruidDataSource的监控数据\n      use-global-data-source-stat: true\n      # 用来检测连接是否有效的sql，要求是一个查询语句\n      validation-query: SELECT 1\n      # Spring 监控，利用aop 对指定接口的执行时间，jdbc数进行记录\n      #aop-patterns: \'com.jrmall.stock.*, com.jrmall.sys.*\'\n      ########## 配置StatViewServlet（监控页面），用于展示Druid的统计信息 ##########\n      stat-view-servlet: #监控页配置\n        # 启用StatViewServlet\n        enabled: true\n        # 访问内置监控页面的路径，内置监控页面的首页是/druid/index.html\n        url-pattern: /druid/*\n        # 配置监控页面访问密码\n        login-username: juru\n        login-password: juru2013\n        # 不允许清空统计数据,重新计算\n        reset-enable: false\n        # 允许访问的地址，如果allow没有配置或者为空，则允许所有访问\n        #allow:\n        # 拒绝访问的地址，deny优先于allow，如果在deny列表中，就算在allow列表中，也会被拒绝\n        #deny:\n      ########## 配置WebStatFilter，用于采集web关联监控的数据 ##########\n      web-stat-filter: # web监控\n        enabled: true\n        url-pattern: /*\n        exclusions: \'*.html,*.js,*.map,*.ts,*.css,*.mp3,*.gif,*.jpg,*.png,*.ico,*.svg,*.woff2,/druid/*\'\n        # 开启session统计功能\n        session-stat-enable: true\n        # session的最大个数,默认100\n        session-stat-max-count: 1000\n      ########### 启用内置过滤器（第一个 stat必须，否则监控不到SQL）##########\n      filters: stat,wall,log4j2\n      filter:\n        stat: # sql监控统计\n          enabled: true\n          log-slow-sql: true\n          slow-sql-millis: 10000\n          merge-sql: true','f3bbcb5c204f32843baf082099e8798e','2025-06-10 14:33:19','2025-06-10 06:33:17','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21312,200,'pilates-system.yaml','DEFAULT_GROUP','','\n# 安全配置\nsecurity:\n  # 允许无需认证的路径列表\n  whitelist-paths:\n    # 获取系统用户的认证信息用于账号密码判读\n    - /api/v1/users/{username}/authInfo\n\nlogging:\n  level:\n    com.youlai: debug\n    com.alibaba: info\n    org.apache.http: info\n    org.springframework.security.oauth2: trace\n  config: classpath:logback-spring.xml\n','2301576e70bc157f118bbfc3136e640e','2025-06-10 14:34:13','2025-06-10 06:34:12','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21309,201,'pilates-auth.yaml','DEFAULT_GROUP','','spring:\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver \n    url: jdbc:mysql://${mysql.host}:${mysql.port}/oauth2_server?zeroDateTimeBehavior=convertToNull&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&autoReconnect=true\n    username: ${mysql.username}\n    password: ${mysql.password}\n  data:\n    redis:\n      database: ${redis.database}\n      host: ${redis.host}\n      port: ${redis.port}\n      password: ${redis.password}\n      lettuce:\n        pool:\n          min-idle: 1\n \n  cache:\n    # 缓存类型 redis、none(不使用缓存) \n    type: redis\n    # 缓存时间(单位：ms)\n    redis:\n      time-to-live: 3600000\n      # 缓存null值，防止缓存穿透\n      cache-null-values: true\n \nfeign:\n  httpclient:\n    enabled: true\n  okhttp:\n    enabled: false\n  sentinel:  # 开启feign对sentinel的支持\n    enabled: false \n\nmybatis-plus:\n  configuration:\n    # 驼峰下划线转换\n    map-underscore-to-camel-case: true\n    # 这个配置会将执行的sql打印出来，在开发或测试的时候可以用\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n    default-enum-type-handler: org.apache.ibatis.type.EnumOrdinalTypeHandler\n\n\n# springdoc-openapi项目配置\nspringdoc:\n  swagger-ui:\n    path: /swagger-ui.html\n    tags-sorter: alpha\n    operations-sorter: alpha\n  api-docs:\n    path: /v3/api-docs\n  group-configs:\n    - group: \'default\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.jrmall.pilates.auth.controller\n  # Api文档信息\n  info:\n    title: 认证服务\n    version: 3.0.0\n    description: 认证、登出、验证码接口\n    contact:\n      name: youlai\n      url: https://www.youlai.tech\n      email: youlaitech@163.com\n    license:\n      name: Apache 2.0\n      url: https://www.apache.org/licenses/LICENSE-2.0.html\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  enable: true\n  setting:\n    language: zh_cn\n\n# 验证码配置\ncaptcha:\n  # 验证码类型 circle-圆圈干扰验证码|gif-Gif验证码|line-干扰线验证码|shear-扭曲干扰验证码\n  type: circle\n  # 验证码宽度\n  width: 120\n  # 验证码高度\n  height: 40\n  # 验证码干扰元素个数\n  interfere-count: 2\n  # 文本透明度(0.0-1.0)\n  text-alpha: 0.8\n  # 验证码字符配置\n  code:\n    # 验证码字符类型 math-算术|random-随机字符\n    type: math\n    # 验证码字符长度，type=算术时，表示运算位数(1:个位数运算 2:十位数运算)；type=随机字符时，表示字符个数\n    length: 1\n  # 验证码字体\n  font:\n    # 字体名称 Dialog|DialogInput|Monospaced|Serif|SansSerif\n    name: SansSerif\n    # 字体样式 0-普通|1-粗体|2-斜体\n    weight: 1\n    # 字体大小\n    size: 24\n  # 验证码有效期(秒)\n  expire-seconds: 120\n','1f70559fb49e9b803a1a479158db49a5','2025-06-10 14:41:32','2025-06-10 06:41:30','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21310,202,'pilates-common.yaml','DEFAULT_GROUP','','redis:\n  database: 0\n  host: 47.99.167.239\n  port: 6379\n  password: pnKnJjjWchNehRRc\n  \nmysql:\n  host: 47.99.167.239\n  port: 3306\n  username: youlai_cloud\n  password: S4DKt3wcYT2mLNAc\n\nrabbitmq:\n  host: localhost\n  port: 5672\n  username: admin\n  password: admin\n  \n# 验签公钥地址\nspring:\n  security:\n    oauth2:\n      authorizationserver:\n        token-uri: http://localhost:9999/pilates-auth/oauth2/token\n      resourceserver:\n        jwt:\n          # issuer-uri: http://127.0.0.1:9000\n          jwk-set-uri: http://localhost:9999/pilates-auth/oauth2/jwks\n\n# 短信配置\nsms:\n  # 阿里云短信\n  aliyun:\n    accessKeyId: LTAI5tSMgfxxxxxxdiBJLyR\n    accessKeySecret: SoOWRqpjtS7xxxxxxZ2PZiMTJOVC\n    domain: dysmsapi.aliyuncs.com \n    regionId: cn-shanghai\n    signName: 有来技术\n    templateCodes: \n      register: SMS_22xxx771\n      login: SMS_22xxx770\n\n\nlogging:\n  level:\n    com.youlai: debug\n    com.alibaba: info\n    org.apache.http: