fere-count: 2\n  # 文本透明度(0.0-1.0)\n  text-alpha: 0.8\n  # 验证码字符配置\n  code:\n    # 验证码字符类型 math-算术|random-随机字符\n    type: math\n    # 验证码字符长度，type=算术时，表示运算位数(1:个位数运算 2:十位数运算)；type=随机字符时，表示字符个数\n    length: 1\n  # 验证码字体\n  font:\n    # 字体名称 Dialog|DialogInput|Monospaced|Serif|SansSerif\n    name: SansSerif\n    # 字体样式 0-普通|1-粗体|2-斜体\n    weight: 1\n    # 字体大小\n    size: 24\n  # 验证码有效期(秒)\n  expire-seconds: 120\n','4ea2b5392947b85b617dc3d173145826','2025-06-10 15:10:22','2025-06-10 07:10:21','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21330,209,'pilates-system-boot.yaml','DEFAULT_GROUP','','spring:\n  data:\n    redis:\n      database: ${redis.database}\n      host: ${redis.host}\n      port: ${redis.port}\n      password: ${redis.password}\n      lettuce:\n        pool:\n          min-idle: 1\n  cache:\n    # 缓存类型 redis、none(不使用缓存) \n    type: redis\n    # 缓存时间(单位：ms)\n    redis:\n      time-to-live: 3600000\n      # 缓存null值，防止缓存穿透\n      cache-null-values: true\n  cloud:\n    sentinel:\n      enabled: false\n      eager: true # 取消控制台懒加载，项目启动即连接Sentinel\n      transport:\n        client-ip: localhost\n        dashboard: localhost:8080\n      datasource:\n        # 限流规则，flow为key，随便定义\n        flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.discovery.server-addr}\n            dataId: ${spring.application.name}-flow-rules\n            groupId: SENTINEL_GROUP\n            data-type: json\n            rule-type: flow\n        # 降级规则\n        degrade:\n          nacos:\n            server-addr: ${spring.cloud.nacos.discovery.server-addr}\n            dataId: ${spring.application.name}-degrade-rules\n            groupId: SENTINEL_GROUP\n            data-type: json\n            rule-type: degrade\n\n# 安全配置\nsecurity:\n  # 允许无需认证的路径列表\n  whitelist-paths:\n    # 获取系统用户的认证信息用于账号密码判读\n    - /api/v1/users/{username}/authInfo\n\n# springdoc-openapi项目配置\nspringdoc:\n  swagger-ui:\n    path: /swagger-ui.html\n    tags-sorter: alpha\n    operations-sorter: alpha\n  api-docs:\n    path: /v3/api-docs\n  group-configs:\n    - group: \'default\'\n      paths-to-match: \'/**\'\n      packages-to-scan: \n        - com.jrmall.pilates.system.controller\n  # Api文档信息\n  info:\n    title: 系统服务\n    version: 3.0.0\n    description: 用户、部门、角色、菜单、字典等接口\n    contact:\n      name: youlai\n      url: https://www.youlai.tech\n      email: youlaitech@163.com\n    license:\n      name: Apache 2.0\n      url: https://www.apache.org/licenses/LICENSE-2.0.html\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  enable: false\n  setting:\n    language: zh_cn\n\n\n\n# 文件存储\noss:\n  # OSS 类型 (目前支持aliyun、minio)\n  type: aliyun\n  # MinIO 对象存储服务\n  minio:\n    # 服务Endpoint\n    endpoint: http://localhost:9000\n    # 访问凭据\n    access-key: minioadmin\n    # 凭据密钥\n    secret-key: minioadmin\n    # 存储桶名称\n    bucket-name: default\n    # (可选)自定义域名，如果配置了域名，生成的文件URL是域名格式，未配置则URL则是IP格式 (eg: https://oss.youlai.tech)\n    custom-domain:\n  # 阿里云OSS对象存储服务\n  aliyun:\n    # 服务Endpoint\n    endpoint: oss-cn-hangzhou.aliyuncs.com\n    # 访问凭据\n    access-key-id: your-access-key-id\n    # 凭据密钥\n    access-key-secret: your-access-key-secret\n    # 存储桶名称\n    bucket-name: default\n','1808455f050828b961272b8818059fca','2025-06-10 15:18:22','2025-06-10 07:18:20','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21311,210,'pilates-gateway.yaml','DEFAULT_GROUP','','spring:\n  data:\n    redis:\n      timeout: PT30S\n      database: ${redis.database}\n      host: ${redis.host}\n      port: ${redis.port}\n      password: ${redis.password}\n      lettuce:\n        pool:\n          # 连接池最小空闲连接数\n          min-idle: 1\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          enabled: true # 启用服务发现\n          lower-case-service-id: true\n      default-filters:\n        # 令牌中继\n        - TokenRelay= \n      routes:\n        - id: pilates-auth\n          uri: lb://pilates-auth\n          predicates:\n            - Path=/pilates-auth/**\n          filters:\n            - StripPrefix=1            \n        - id: pilates-system-boot\n          uri: lb://pilates-system-boot\n          predicates:\n            - Path=/pilates-system-boot/**\n          filters:\n            - StripPrefix=1            \n      globalcors:\n        corsConfigurations:\n          \'[/**]\': # 对所有路由应用CORS配置\n            # 允许所有域名的请求\n            allowedOriginPatterns: \"*\"\n            # 允许所有请求方法，如GET、POST、PUT、DELETE等\n            allowedMethods: \"*\"\n             # 允许所有请求头\n            allowedHeaders: \"*\" \n            # 允许凭证，如Cookies和HTTP认证\n            allowCredentials: true   \n            maxAge: 3600\n\n# 安全配置\nsecurity:\n  # 访问黑名单\n  blacklist-paths:\n      # 获取用户认证信息\n      - /pilates-system-boot/api/v1/users/{username}/authInfo\n\n# knife4j 网关聚合  \n# https://doc.xiaominfo.com/docs/middleware-sources/spring-cloud-gateway/spring-gateway-introduction\nknife4j:\n  gateway:\n    enabled: true\n    # 指定服务发现的模式聚合微服务文档，并且是默认`default`分组\n    strategy: discover\n    discover:\n      enabled: true\n      # 聚合所有子服务(swagger2规范)，子服务是3规范则替换为openapi3\n      version: openapi3\n      # 需要排除的微服务(eg:网关服务) \n      excluded-services:\n          - pilates-gateway\n\n','ca5e784b6602580b3995348aa009b42f','2025-06-10 15:22:54','2025-06-10 07:22:52','nacos','0:0:0:0:0:0:0:1','U','pilates-cloud-dev','','formal','','{\"type\":\"yaml\",\"src_user\":\"nacos\"}'),(21339,211,'com.jrmall.pilates.system.api.DeptApi:::provider:pilates-system-provider','dubbo','','{\"annotations\":[],\"canonicalName\":\"com.jrmall.pilates.system.api.DeptApi\",\"codeSource\":\"file:/Users/daoyang/IdeaProjects/jrmall-pilates-cloud/pilates-system/system-api-boot/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"listDepartments\",\"parameterTypes\":[\"com.jrmall.pilates.system.model.query.DeptQuery\"],\"parameters\":[],\"returnType\":\"java.util.List<com.jrmall.pilates.sys